// SPDX-License-Identifier: GPL-3.0

pragma solidity >=0.7.0 <0.9.0;

contract Computer {

    struct computer {
        bool available;
        address occupant;
    }

    mapping (uint => computer) computers;
    // {
        // 1: computer({available: true, occupant: 0}),
        // 2: computer({available: true, occupant: 0}),
        // 3: computer({available: true, occupant: 0}),
        // 4: computer({available: true, occupant: 0}),
        // 5: computer({available: true, occupant: 0}),
        // 6: computer({available: true, occupant: 0}),
        // 7: computer({available: true, occupant: 0}),
        // 8: computer({available: true, occupant: 0}),
        // 9: computer({available: true, occupant: 0}),
        // 10: computer({available: true, occupant: 0}),
    // };
    // let computer = await Computer.deployed()

    constructor() {
        computers[1] = computer({available: true, occupant: address(0)});
    }

    function use_computer(uint index) public {
        if (index > 0 && index <= 10) {
            if (computers[index].available) {
                computers[index].available = false;
                computers[index].occupant = msg.sender;
            }
        }
    }

    function left_computer(uint index) public {
        if (index > 0 && index <= 10) {
            if (!computers[index].available && computers[index].occupant == msg.sender) {
                computers[index].available = true;
                computers[index].occupant = address(0);
            }
        }
    }

    function retrieve_computer_is_available(uint index) public view returns (bool){
        return computers[index].available;
    }

    function retrieve_computer_current_address(uint index) public view returns (address){
        return computers[index].occupant;
    }

}
